import './App.css';
import React, {Component} from 'react';
import Number from './Number/Number';

class App extends Component {

  state = {
    numbers: [
      {value: 0},
      {value: 0},
      {value: 0},
      {value: 0},
      {value: 0},
    ]
  }

  newNumbers = () => {
    let numbers = this.state.numbers;

    const min = 5;
    const max = 36;
    const rand0 = Math.round(min + Math.random() * (max - min));
    var rand1 = 0;
    var rand2 = 0;
    var rand3 = 0;
    var rand4 = 0;

    while(true)
    {
      rand1 = Math.round(min + Math.random() * (max - min));
      if (rand1 !== rand0) break;
    }
    while(true)
    {
      rand2 = Math.round(min + Math.random() * (max - min));
      if (rand2 !== rand0 && rand1 !== rand2) break;
    }
    while(true)
    {
      rand3 = Math.round(min + Math.random() * (max - min));
      if (rand3 !== rand0 && rand3!== rand1 && rand3!== rand2) break;
    }
    while(true)
    {
      rand4 = Math.round(min + Math.random() * (max - min));
      if (rand4 !== rand0 && rand4!== rand1 && rand4!== rand2 && rand4!== rand3) break;
    }


    //const rand = Math.min(rand0,rand1,rand2,rand3,rand4);

    numbers[0].value = rand0;
    numbers[1].value = rand1;
    numbers[2].value = rand2;
    numbers[3].value = rand3;
    numbers[4].value = rand4;

    numbers.sort(function(a, b) {
      return a - b;
    });

    this.setState({numbers});
  };

  render() {
    return (
      <div className="App">
      <div> <button onClick={this.newNumbers}> New numbers </button></div>
        <header className="App-header">
          <Number value={this.state.numbers[0].value} >  </Number>
          <Number value={this.state.numbers[1].value} > </Number>
          <Number value={this.state.numbers[2].value} > </Number>
          <Number value={this.state.numbers[3].value} > </Number>
          <Number value={this.state.numbers[4].value} > </Number>
        </header>
      </div>
    );
  }

}

export default App;
